import axios from "axios";
const request = axios.create({
    baseURL: '',
    timeout: 10000,
});
http.interceptors.request.use(config => {
    return config;
}, error => {
    return Promise.reject(error);
});
http.interceptors.response.use(response => {
    return response.data;
}, error => {
    return Promise.reject(error);
});
export default request;
